package debug;

public class Calculator {
	public Calculator() {
		// TODO Auto-generated constructor stub
	}

	private int plus(int a, int b) {
		return a + b;
	}

	private int minus(int a, int b) {
		return a - b;
	}

	private int multi(int a, int b) {
		return a * b;
	}

	private int divide(int a, int b) {
		return a / b;
	}

}
